async function prt() {
    const base64Pdf =
        "";


    const blobPdfFromBaseUint8Array = baseUint8Array => {
        return new Blob([baseUint8Array], { type: 'application/pdf' });
    };

    const mergePdfs = async base64Pdfs => {
        const mergedPdf = await window.PDFLib.PDFDocument.create();

        const pdfReadPromises = base64Pdfs.map(item => window.PDFLib.PDFDocument.load(item));
        const pdfs = await Promise.all(pdfReadPromises);

        const contentPagesPromises = pdfs.map(pdf =>
            mergedPdf.copyPages(pdf, pdf.getPageIndices())
        );
        const contentPages = await Promise.all(contentPagesPromises);

        contentPages.forEach(contentPage =>
            contentPage.forEach(page => mergedPdf.addPage(page))
        );

        return mergedPdf.save();
    };


    const downloadBlob = blob => {
        const blobUrl = URL.createObjectURL(blob);

        const w = window.open(blobUrl);
        w.print();
    };

    const base64Pdfs = [base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf,base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf,base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf,base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf,base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf, base64Pdf];

    const mergedPdf = await mergePdfs(base64Pdfs);
    const blob = blobPdfFromBaseUint8Array(mergedPdf);

    downloadBlob(blob);
}

function printModal() {
    const base64Pdf =
        "";

    const blobPdfFromBase64String = (base64String) => {
        const byteArray = Uint8Array.from(
            atob(base64String)
                .split("")
                .map((char) => char.charCodeAt(0))
        );
        return new Blob([byteArray], { type: "application/pdf" });
    };

    const downloadBlob = (blob, name) => {
        const frameId = 'printJS';
        // To prevent duplication and issues, remove any used printFrame from the DOM
        const usedFrame = document.getElementById(frameId)

        if (usedFrame) usedFrame.parentNode.removeChild(usedFrame)

        const printFrame = document.createElement('iframe');
        // Set iframe element id
        printFrame.setAttribute('id', frameId)

        console.log(printFrame)

        const blobUrl = URL.createObjectURL(blob);
        // Set iframe src with pdf document url
        printFrame.setAttribute('src', blobUrl)
        document.getElementsByTagName('body')[0].appendChild(printFrame)

        printFrame.focus();
        printFrame.contentWindow.print();
    };

    const blob = blobPdfFromBase64String(base64Pdf);
    downloadBlob(blob);
}


document.getElementById("test-blob").addEventListener("click", prt);
document.getElementById("test-modal").addEventListener("click", printModal);
